CREATE TABLE `tiss` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `usuario_id` int(11) DEFAULT NULL,
  `paciente_id` int(11) DEFAULT NULL,
  `registroans_id` int(11) DEFAULT NULL,
  `numeroguias` int(11) DEFAULT NULL,
  `numeroguiasoperadora` int(11) DEFAULT NULL,
  `numerocartao` int(11) DEFAULT NULL,
  `validadecarteira` date DEFAULT NULL,
  `recemnascido` varchar(10) DEFAULT NULL,
  `nomepaciente` varchar(255) DEFAULT NULL,
  `numerocns` int(11) DEFAULT NULL,
  `tipodocumentoprestador` varchar(255) DEFAULT NULL,
  `documentoprestador` varchar(255) DEFAULT NULL,
  `nomeprestador` varchar(255) DEFAULT NULL,
  `codigocnes` int(11) DEFAULT NULL,
  `nomeexecutor` varchar(255) DEFAULT NULL,
  `conselho_id` int(11) DEFAULT NULL,
  `numeroconselho` int(11) DEFAULT NULL,
  `ufexecutor` varchar(2) DEFAULT NULL,
  `cbo_id` int(11) DEFAULT NULL,
  `indicacaoacidente_id` int(11) DEFAULT NULL,
  `dataconsulta` date DEFAULT NULL,
  `tipoconsulta_id` int(11) DEFAULT NULL,
  `codigotabela_id` int(11) DEFAULT NULL,
  `codigoprocedimento_id` int(11) DEFAULT NULL,
  `valorprocedimento` decimal(10,2) DEFAULT NULL,
  `observacoes` text,
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `modified` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

